function TaskList({ tasks, onToggleComplete, onEdit, onDelete }) {
  return (
    <span className="task-list">
      {tasks.map((task) => (
        <TaskItem
          key={task._id}
          task={task}
          onToggle={onToggleComplete} // passer la bonne fonction
          onEdit={onEdit}
          onDelete={onDelete}
        />
      ))}
    </span>
  );
}
